import Link from "../../components/link";

export default function ContentHome() {
  return (
    <div className={"lg:px-20"}>
        <div>
            <InfoPanel headline={"Nejoblíbenější ligy"}>
                <Link text={"Premier League"}></Link>
            </InfoPanel>
        </div>
        <div></div>
    </div>
  );
}
